INSERT INTO `bis_goods_spu_source` VALUES ('316', '10', '苏宁易购 (自营)', 'Phone 7拥有金色、银色、玫瑰金色、黑色、亮黑色、红色(特别版，后增加)六种颜色。 \nHome键有了全新的设计，添加了振动反馈。并且支持IP67防溅抗水防尘功能 ，前/后单摄像头，防抖功能，新增了速度更快的A10 Fusion处理器。\niPhone 7取消了3.5mm耳机接口，推出新耳机Apple AirPods，采用W1芯片，有传感器，电池，都放在小小的耳机机身中。 \niPhone 7 Plus的电池容量只有2900mAh，相比iPhone 6 Plus上的2915mAh在容量上还小那么一点点，却能建立在更强悍的A10 Fusion处理器上多提供超过一个小时的续航时间,iPhone 7 Plus使用双摄像头。\n新iPhone取消了16GB机型，最低存储容量为32GB，另外两个容量是128GB和256GB。', 'http://img.alicdn.com/imgextra/i2/2616970884/O1CN01uXR6Mq1IOucDisEVL_!!0-item_pic.jpg', 'https://c.duomai.com/track.php?site_id=134541&aid=84&euid=&t=https%3a%2f%2fproduct.suning.com%2f0000000000%2f690098234.html', '2999', '2999', '2019-07-16 15:35:31', '18342', '70309', '100001', '2019-07-16 15:35:31', '2019-07-19 17:19:37', 'Apple iPhone 7 Plus (A1661) 128G 玫瑰金色 移动联通电信4G手机', '苹果', '手机', '3', '1', '4');
