INSERT INTO `bis_goods_spu_source` VALUES ('344', '11', '新蛋网 (自营)', '机身搭载7nm工艺的A12仿生芯片，采用TrueDepth摄像头，支持Face ID功能。\n背部采用1200万像素单摄像头，由于A12芯片的加持，iPhone XR支持人像模式。\niPhone XR搭载了6.1英寸LCD屏幕，分辨率为1792x828，具备326PPi，苹果将这款屏幕命名为液体视网膜（LiquidRetina）屏。不过相比iPhone XS，这款手机并不支持3D Touch，但是支持点击唤醒。在存储配置上，该机具备64GB、128GB和256GB三个版本。\niPhone XR搭载了“神经引擎”AI处理。iPhone XR将搭载后置单摄像头，类似于iPhone 8，iPhone XR前置摄像头支持TrueDepth深感技术，700万像素的传感器，支持Face ID以及人像模式自拍，同时支持Animoji和Memoji等。', 'http://gfs17.gomein.net.cn/T1nzZgBCYv1RCvBVdK_450.jpg', 'http://www.b1bj.com/ProductDetail.aspx?itemid=538123891227&skuId=3252455348669', '12999', '12999', '2019-07-16 15:35:31', '7639', '842739', '100001', '2019-07-16 15:35:31', '2019-07-19 17:19:58', 'Apple iPhone XR (A2108) 128GB 黑色 移动联通电信4G手机 双卡双待', '苹果', '手机', '3', '1', '15');
