DROP TABLE IF EXISTS `bis_goods_brand`;
CREATE TABLE `bis_goods_brand` (
  `gb_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '品牌id',
  `gb_name` varchar(255) NOT NULL COMMENT '品牌名称',
  `gb_gc_id` bigint(20) DEFAULT NULL COMMENT '品牌所属分类',
  `gb_state` char(6) NOT NULL DEFAULT '100001' COMMENT '状态标志',
  `gb_created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gb_updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`gb_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='品牌表';

