  `gss_spu_category` varchar(256) DEFAULT NULL COMMENT '商品分类',
  `gss_spu_brand_id` int(20) DEFAULT NULL,
  `gss_spu_category_id` int(20) DEFAULT NULL,
  `gss_name_id` int(20) DEFAULT '0' COMMENT '来源id(商城)',
