-- ----------------------------
-- Table structure for `bis_user`
-- ----------------------------
DROP TABLE IF EXISTS `bis_user`;
CREATE TABLE `bis_user` (
  `user_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自然主键,全局唯一',
  `user_phone` varchar(16) NOT NULL COMMENT '手机号',
  `user_nickname` varchar(128) NOT NULL DEFAULT '' COMMENT '昵称',
  `user_email` varchar(128) DEFAULT NULL COMMENT '电子邮件',
  `user_birth` datetime DEFAULT NULL COMMENT '出生年月日',
  `user_type` varchar(100) DEFAULT NULL COMMENT '用户类型',
  `user_sex` char(4) DEFAULT '保密' COMMENT '性别',
  `user_balance` float(10,2) unsigned DEFAULT '0.00' COMMENT '账户余额',
  `user_headImgurl` mediumtext COMMENT '修改时间',
  `user_remark` varchar(512) DEFAULT NULL COMMENT '备注',
  `user_state` char(6) DEFAULT '100001' COMMENT '状态标志',
  `user_created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `user_updated` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `user_password` varchar(2048) DEFAULT NULL COMMENT '用户密码',
  PRIMARY KEY (`user_id`,`user_nickname`),
  UNIQUE KEY `uk_phone` (`user_phone`),
  UNIQUE KEY `uk_email` (`user_email`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8 COMMENT='平台用户表';

-- ----------------------------
-- Records of bis_user
-- ----------------------------

